import React from 'react';
import './UI/time.css';

const Time = () => {

    let date = new Date();
    let day = date.getDate();
    let month = date.getMonth();
    let year = date.getFullYear();
    let hour = date.getHours();
    let min = date.getMinutes();
    let sec = date.getSeconds();
    let milliSec = date.getMilliseconds();
    let timeDate = document.querySelector('.timeDate');
    timeDate.innerHTML = `${this.addZero(day)}.${this.addZero(month)}.${year} <span>${this.addZero(hour)}:${this.addZero(min)}:${this.addZe(sec)}`;
    

    return (
        <div>
            <div className='timeDate'>
                <div className='time'>12:53</div>
                <div className='date'>23.07.2023</div>
            </div>
        </div>
    );
}

export default Time;
